import streamlit as st

st.tabs(["Home", "About", "Contact"])
st.title("Comparison")

col1,col2,col3 = st.columns(3)

with col1:
    st.subheader("Streamlit")
    st.image("data:image/jpeg;base64,",width = 150)
    streamlit_pref = st.slider("preference",0,10,key="streamlit_pref")
with col2:
    st.subheader("React")
    st.image("data:image/jpeg;base64,",width = 150)
    react_pref = st.slider("preference", 0, 10,key="react_pref")
with col3:
    st.subheader("Flutter")
    st.image("data:image/jpeg;base64,",width = 150)
    flutter_pref = st.slider("preference", 0, 10,key="flutter_pref")

preferences = {
    "Streamlit": streamlit_pref,
    "React": react_pref,
    "Flutter": flutter_pref
}

preferred_framework = max(preferences, key=preferences.get)

st.success("Preference is: **{}** (score: {})".format(preferred_framework, preferences[preferred_framework]))

selected_chat = st.sidebar.button("page one")

with st.expander("steps to be a developer"):
    st.write("""
    1.strong basics\n
    2.good coding\n
    3.communication
    """)

st.markdown("Story")
st.markdown(">contents")